query:
UPDATE workflowSteps 
SET stepId = 'cadastro', stepTitle = 'Cadastro' 
WHERE (stepTitle = '' OR stepTitle IS NULL) 
AND id IN (
  SELECT MIN(id) FROM workflowSteps GROUP BY clientId
);

